import { useStyles } from '../App';
import React from 'react';
import PropTypes from 'prop-types';
import Button from '@material-ui/core/Button';
import Box from '@material-ui/core/Box';
import AddIcon from '@material-ui/icons/Add';
import { TaskBubble } from '../taskBubble/TaskBubble';

export function TaskList(props) {
    const { type, date } = props;

    let title = "";

    switch(type) {
    case "work":
        title = "Pr치ca";
        break;
    case "produc":
        title = "Produkcia";
        break;
    case "comm":
        title = "Komunik치cia";
        break;
    default:
        title = "";
        break;
    }

    return (
    <Box padding={'0px 50px'} width={'25%'} style={ type=="work" ? {border: '3px solid #ebebeb', borderTop: 0, borderBottom: 0} : {}}>
        <span style={{display: 'flex', alignItems: 'center', justifyContent: 'center'}}>
        <h2>
            {title}
        </h2>
        <Button style={{maxWidth: '20px', maxHeight: '20px', minWidth: '20px', minHeight: '20px', marginLeft: '8px'}}>
            <AddIcon />
        </Button>
        </span>

        {TaskBubble(type)}
    </Box>
    );
}

TaskList.propTypes = {
    type: PropTypes.string.isRequired,
    date: PropTypes.string.isRequired,
};
